import React from 'react';
import classes from './Contact.module.css';
import { Routes, Route } from 'react-router-dom';

const Contact = (props) => {

  const emailClikedHandler = () => {
    props.history.push('/contact/email');
  }

  const callClikedHandler = () => {
    console.log('Call cliked');
  }


  return (
    <>
      <h1>Contact</h1>
      <button onClick={emailClikedHandler} className={classes.button}>Email</button>
      <button onClick={callClikedHandler} className={classes.button}>Téléphone</button>

      <Routes>
        <Route path="/contact/email" element={<h1>Email</h1>} />
        <Route path="/contact/call" element={<h1>Call</h1>} />
      </Routes>
    </>
  );
};

export default Contact;
